import {BEGIN_GET_USERDATA, 
        GET_USERDATA_OK, 
        GET_USERDATA_ERROR
} from '../types/index';
import clienteAxios from '../config/axios';
export function getUserDataAction(data){

    return async(dispatch) =>{

            dispatch( getuserData() )
            try {   

                const resultado = await clienteAxios.get('/users');    
                console.log(resultado);        
                dispatch( getUserDataOk(resultado.data) )
            
                
            } catch (error) {
                console.log(error);
            }
    }
}
const getuserData = () => ({

    type: BEGIN_GET_USERDATA
})
const getUserDataOk = (dbdatos) => ({

    type: GET_USERDATA_OK,
    payload: dbdatos

})
